import React, { useState } from 'react';
      
export default function FormUsingFunComponent() {
  const [name, setName] = useState('');
      
  function handleChange(e)  {
 
    setName(e.target.value);
  };
      
  return (
    <>
     <div>
        Name:
        <input
          type='text'
          value={name}
          onChange={handleChange}
        />
      </div>
      <div>Name is: {name}</div>
      </>           
  );
}
